import React from "react";

const Rank = ({name, entries}) => {
    return (
        <div className="center mv5">
            <div className="white f3">
                {`{name}, Your current rank is ...`}
            </div>
            <div className="white f3">
                {"#5"}
            </div>
        </div>
    );
}

export default Rank;
